#define O(z) printf(#z "=[");for(i=0;i<sizeof(z)-1;i++) {printf("%d, ", z[i]);}; printf("%d]\n", z[i])
#define P(z) printf("$" #z "=\"");for(i=0;i<sizeof(z);i++) {printf("%02x",z[i]);}; printf("\";\n") 
